import Card from 'react-bootstrap/Card';

function ProjectItem(props) {

    const { children, project, ...other } = props;

    return (
        <div>
            <Card className='project-card'>
                <Card.Body>
                    <Card.Title style={{fontSize: "2em"}}>{projects.title}</Card.Title>
                    <Card.Subtitle style={{fontSize: "1.25em"}} className="mb-2 text-muted">{projects.dates}</Card.Subtitle>
                    <Card.Text>{projects.details}</Card.Text>
                </Card.Body>
            </Card>
        </div>
    );
}

export default ProjectItem;
